INSERT INTO public.photospot_reviews (created_at,created_by,rating,text,photospot_id,edited,id) VALUES (DEFAULT, 'c9fe6565-6bb6-4a4c-a1cd-7fbe244f4599', 2, 'Beautiful spot, but be careful of the steep cliffs.', 3, DEFAULT, 417343), (DEFAULT, '885a0c00-1512-4442-8edd-d5cbe7e43ecc', 2, 'Perfect spot for a peaceful morning meditation.', 3, DEFAULT, 10496578), (DEFAULT, 'e5a2c764-53b1-4820-82df-6855b070285a', 3, 'Bring a map and compass, even with GPS. The trails can be confusing.', 3, DEFAULT, 7323265), (DEFAULT, 'e529c355-b9ff-4fd7-b4ff-bbb34eadef95', 5, 'Beautiful spot, but wish there were more signs indicating the trails.', 3, DEFAULT, 15069634), (DEFAULT, '7228984f-c255-410f-9b19-c97eed9e9e75', 1, 'This spot is perfect for a romantic evening stroll.', 3, DEFAULT, 3566082), (DEFAULT, '27e02716-988f-4cd4-a694-124a81b7f5c0', 2, 'The hike was tougher than expected, but the scenery was well worth it.', 3, DEFAULT, 4249445), (DEFAULT, 'fef3078b-3ef3-488c-91d9-aa8ad1f54d29', 3, 'Bring sunscreen and a hat, even on cloudy days.', 3, DEFAULT, 3874771), (DEFAULT, '8117f5dd-ad95-4c45-b393-b48ce35b1899', 5, 'This spot is perfect for a romantic evening stroll.', 3, DEFAULT, 8808284);
INSERT INTO public.photoshots (id,created_at,photospot_id,name,recreate_text,photo_paths,created_by) VALUES (31, DEFAULT, 3, 'Sandy Toes', 'Capture a photo of yourself standing in front of a colorful graffiti wall, wearing a trendy outfit and holding a pair of sunglasses.', '{"https://picsum.photos/id/458/400/400","https://picsum.photos/id/867/400/400","https://picsum.photos/id/919/400/400"}', NULL), (32, DEFAULT, 3, 'Mountain Climbing', 'To recreate, find a historic landmark, wear a cultural outfit and hold a souvenir.', '{"https://picsum.photos/id/654/400/400","https://picsum.photos/id/559/400/400","https://picsum.photos/id/150/400/400"}', NULL), (33, DEFAULT, 3, 'Tropical Oasis', 'Recreate by posing on a skateboard, wearing a helmet and holding a skateboard.', '{"https://picsum.photos/id/995/400/400","https://picsum.photos/id/862/400/400","https://picsum.photos/id/255/400/400"}', NULL), (34, DEFAULT, 3, 'Sunny Days', 'To recreate, find a historic landmark, wear a cultural outfit and hold a souvenir.', '{"https://picsum.photos/id/526/400/400","https://picsum.photos/id/140/400/400","https://picsum.photos/id/444/400/400"}', NULL), (35, DEFAULT, 3, 'Summer Nights', 'Recreate by standing in front of a plain white background, wearing a yellow dress and holding a bouquet of flowers.', '{"https://picsum.photos/id/793/400/400","https://picsum.photos/id/8/400/400","https://picsum.photos/id/853/400/400"}', NULL), (36, DEFAULT, 3, 'New York City Skyline', 'Capture a photo of yourself standing in front of a beautiful garden, wearing a wide-brimmed hat and holding a basket of flowers.', '{"https://picsum.photos/id/562/400/400","https://picsum.photos/id/286/400/400","https://picsum.photos/id/198/400/400"}', NULL), (37, DEFAULT, 3, 'Tropical Oasis', 'Recreate by posing on a motorcycle, wearing a helmet and holding a GPS.', '{"https://picsum.photos/id/424/400/400","https://picsum.photos/id/440/400/400","https://picsum.photos/id/848/400/400"}', NULL), (38, DEFAULT, 3, 'Nighttime Cityscape', 'To recreate, find a minimalist background, wear a simple dress and hold a book.', '{"https://picsum.photos/id/779/400/400","https://picsum.photos/id/937/400/400","https://picsum.photos/id/413/400/400"}', NULL), (39, DEFAULT, 3, 'Fashionable Friends', 'Sit on a porch swing, wearing a comfortable outfit and holding a glass of lemonade.', '{"https://picsum.photos/id/949/400/400","https://picsum.photos/id/166/400/400","https://picsum.photos/id/610/400/400"}', NULL), (40, DEFAULT, 3, 'Seaside Fun', 'Recreate by standing in a luxurious dressing room, wearing a glamorous gown and holding a diamond necklace.', '{"https://picsum.photos/id/482/400/400","https://picsum.photos/id/390/400/400","https://picsum.photos/id/851/400/400"}', NULL), (41, DEFAULT, 3, 'Foodie Heaven', 'Recreate by standing in a modern kitchen, wearing a chef''s hat and holding a mixing bowl.', '{"https://picsum.photos/id/104/400/400","https://picsum.photos/id/904/400/400","https://picsum.photos/id/603/400/400"}', NULL), (42, DEFAULT, 3, 'Mountain Peak', 'To recreate, find a minimalist background, wear a simple dress and hold a book.', '{"https://picsum.photos/id/292/400/400","https://picsum.photos/id/544/400/400","https://picsum.photos/id/886/400/400"}', NULL), (43, DEFAULT, 3, 'City Lights at Night', 'Sit on a porch swing, wearing a comfortable outfit and holding a glass of lemonade.', '{"https://picsum.photos/id/523/400/400","https://picsum.photos/id/609/400/400","https://picsum.photos/id/417/400/400"}', NULL), (44, DEFAULT, 3, 'Laughter and Memories', 'To recreate, find a cozy coffee shop, wear a scarf and hold a laptop.', '{"https://picsum.photos/id/131/400/400","https://picsum.photos/id/305/400/400","https://picsum.photos/id/93/400/400"}', NULL), (45, DEFAULT, 3, 'Floral Beauty', 'Capture a photo of yourself sitting on a couch, surrounded by pillows, wearing a cozy sweater and holding a warm cup of coffee.', '{"https://picsum.photos/id/141/400/400","https://picsum.photos/id/137/400/400","https://picsum.photos/id/672/400/400"}', NULL);
