INSERT INTO public.photoshots (id,created_at,photospot_id,name,recreate_text,photo_paths,created_by) VALUES (91, DEFAULT, 7, 'Urban Exploration', 'Capture a photo of yourself standing in front of a beautiful waterfall, wearing a swimsuit and holding a towel.', '{"https://picsum.photos/id/212/400/400","https://picsum.photos/id/91/400/400","https://picsum.photos/id/401/400/400"}', NULL), (92, DEFAULT, 7, 'Smiling Friends', 'To recreate, find a bustling street market, wear a colorful outfit and hold a basket of fruit.', '{"https://picsum.photos/id/201/400/400","https://picsum.photos/id/604/400/400","https://picsum.photos/id/660/400/400"}', NULL), (93, DEFAULT, 7, 'Wildlife Adventure', 'To recreate, find a scenic outdoor location with a mountainous backdrop, wear a pair of hiking boots and hold a trekking pole.', '{"https://picsum.photos/id/585/400/400","https://picsum.photos/id/261/400/400","https://picsum.photos/id/75/400/400"}', NULL), (94, DEFAULT, 7, 'Foodie Heaven', 'Sit on a beach towel, wearing a swimsuit and sunglasses, and hold a surfboard.', '{"https://picsum.photos/id/571/400/400","https://picsum.photos/id/415/400/400","https://picsum.photos/id/331/400/400"}', NULL), (95, DEFAULT, 7, 'New York City Skyline', 'To recreate, find a minimalist background, wear a simple dress and hold a book.', '{"https://picsum.photos/id/562/400/400","https://picsum.photos/id/872/400/400","https://picsum.photos/id/83/400/400"}', NULL), (96, DEFAULT, 7, 'Winter Sports', 'To recreate, find a modern gym, wear a workout outfit and hold a pair of dumbbells.', '{"https://picsum.photos/id/702/400/400","https://picsum.photos/id/548/400/400","https://picsum.photos/id/342/400/400"}', NULL), (97, DEFAULT, 7, 'Urban Exploration', 'Recreate by standing in a vintage-style bar, wearing a suit and holding a cocktail.', '{"https://picsum.photos/id/846/400/400","https://picsum.photos/id/73/400/400","https://picsum.photos/id/953/400/400"}', NULL), (98, DEFAULT, 7, 'Sunny Days', 'Capture a photo of yourself standing in front of a stunning sunset, wearing a comfortable outfit and holding a camera.', '{"https://picsum.photos/id/205/400/400","https://picsum.photos/id/497/400/400","https://picsum.photos/id/566/400/400"}', NULL), (99, DEFAULT, 7, 'Mountain Climbing', 'Recreate by standing in a modern kitchen, wearing a chef''s hat and holding a mixing bowl.', '{"https://picsum.photos/id/261/400/400","https://picsum.photos/id/369/400/400","https://picsum.photos/id/320/400/400"}', NULL), (100, DEFAULT, 7, 'Happy Couple', 'To recreate, find a bustling street market, wear a colorful outfit and hold a basket of fruit.', '{"https://picsum.photos/id/322/400/400","https://picsum.photos/id/422/400/400","https://picsum.photos/id/770/400/400"}', NULL), (101, DEFAULT, 7, 'City Lights at Night', 'Recreate by posing on a skateboard, wearing a helmet and holding a skateboard.', '{"https://picsum.photos/id/295/400/400","https://picsum.photos/id/43/400/400","https://picsum.photos/id/813/400/400"}', NULL), (102, DEFAULT, 7, 'Sunset at the Beach', 'To recreate, find a trendy cafe, wear a fashionable outfit and hold a coffee cup.', '{"https://picsum.photos/id/573/400/400","https://picsum.photos/id/223/400/400","https://picsum.photos/id/1/400/400"}', NULL), (103, DEFAULT, 7, 'Smiling Friends', 'To recreate, find a beautiful garden, wear a gardening outfit and hold a watering can.', '{"https://picsum.photos/id/157/400/400","https://picsum.photos/id/421/400/400","https://picsum.photos/id/453/400/400"}', NULL), (104, DEFAULT, 7, 'City Lights at Night', 'To recreate, find a rustic wooden background, wear a plaid shirt and hold a fishing rod.', '{"https://picsum.photos/id/598/400/400","https://picsum.photos/id/517/400/400","https://picsum.photos/id/284/400/400"}', NULL), (105, DEFAULT, 7, 'Fashionable Friends', 'Sit on a porch swing, wearing a comfortable outfit and holding a glass of lemonade.', '{"https://picsum.photos/id/801/400/400","https://picsum.photos/id/835/400/400","https://picsu