INSERT INTO public.photospot_reviews (created_at,created_by,rating,text,photospot_id,edited,id) VALUES (DEFAULT, '27e02716-988f-4cd4-a694-124a81b7f5c0', 3, 'Bring a map and compass, even with GPS. The trails can be confusing.', 10, DEFAULT, 1340615), (DEFAULT, 'e5a2c764-53b1-4820-82df-6855b070285a', 1, 'The scenic views from the top are well worth the challenging hike.', 10, DEFAULT, 6716865), (DEFAULT, '3a2e5788-d2ad-4939-8079-5ec8a0ab6cc1', 5, 'Wish I had more time to explore, but the views from the top were incredible.', 10, DEFAULT, 5059020), (DEFAULT, '7228984f-c255-410f-9b19-c97eed9e9e75', 1, 'Bring a jacket, even in the summer. It gets chilly in the evenings.', 10, DEFAULT, 2176110), (DEFAULT, 'c9fe6565-6bb6-4a4c-a1cd-7fbe244f4599', 2, 'Bring bug spray! The mosquitoes were relentless, but the views were stunning.', 10, DEFAULT, 9074607), (DEFAULT, '885a0c00-1512-4442-8edd-d5cbe7e43ecc', 4, 'The scenic drive to the spot was an adventure in itself.', 10, DEFAULT, 15782258), (DEFAULT, '8117f5dd-ad95-4c45-b393-b48ce35b1899', 4, 'Beautiful spot, but be careful of the wildlife.', 10, DEFAULT, 5070700), (DEFAULT, 'e529c355-b9ff-4fd7-b4ff-bbb34eadef95', 3, 'This spot is perfect for a fun family outing.', 10, DEFAULT, 16415800);
INSERT INTO public.photoshots (id,created_at,photospot_id,name,recreate_text,photo_paths,created_by) VALUES (136, DEFAULT, 10, 'Nighttime Cityscape', 'To recreate, find a minimalist background, wear a simple dress and hold a book.', '{"https://picsum.photos/id/579/400/400","https://picsum.photos/id/699/400/400","https://picsum.photos/id/772/400/400"}', NULL), (137, DEFAULT, 10, 'Seaside Fun', 'Capture a photo of yourself sitting on a couch, surrounded by pillows, wearing a cozy sweater and holding a warm cup of coffee.', '{"https://picsum.photos/id/416/400/400","https://picsum.photos/id/236/400/400","https://picsum.photos/id/690/400/400"}', NULL), (138, DEFAULT, 10, 'City Break', 'Capture a photo of yourself standing in front of a colorful graffiti wall, wearing a trendy outfit and holding a pair of sunglasses.', '{"https://picsum.photos/id/587/400/400","https://picsum.photos/id/23/400/400","https://picsum.photos/id/407/400/400"}', NULL), (139, DEFAULT, 10, 'Fashion Show', 'Capture a photo of yourself standing in front of a stunning sunset, wearing a comfortable outfit and holding a camera.', '{"https://picsum.photos/id/931/400/400","https://picsum.photos/id/722/400/400","https://picsum.photos/id/343/400/400"}', NULL), (140, DEFAULT, 10, 'Sandy Toes', 'Capture a photo of yourself standing in front of a beautiful waterfall, wearing a swimsuit and holding a towel.', '{"https://picsum.photos/id/212/400/400","https://picsum.photos/id/132/400/400","https://picsum.photos/id/484/400/400"}', NULL), (141, DEFAULT, 10, 'Golden Hour in Paris', 'Recreate by posing on a skateboard, wearing a helmet and holding a skateboard.', '{"https://picsum.photos/id/631/400/400","https://picsum.photos/id/271/400/400","https://picsum.photos/id/682/400/400"}', NULL), (142, DEFAULT, 10, 'Summer Nights', 'Recreate by standing in a luxurious dressing room, wearing a glamorous gown and holding a diamond necklace.', '{"https://picsum.photos/id/474/400/400","https://picsum.photos/id/274/400/400","https://picsum.photos/id/977/400/400"}', NULL), (143, DEFAULT, 10, 'Tropical Island Getaway', 'Sit on a beach towel, wearing a swimsuit and sunglasses, and hold a surfboard.', '{"https://picsum.photos/id/894/400/400","https://picsum.photos/id/798/400/400","https://picsum.photos/id/978/400/400"}', NULL), (144, DEFAULT, 10, 'Summer Vibes', 'Recreate by standing in a modern kitchen, wearing a chef''s hat and holding a mixing bowl.', '{"https://picsum.photos/id/692/400/400","https://picsum.photos/id/887/400/400","https://picsum.photos/id/718/400/400"}', NULL), (145, DEFAULT, 10, 'Happy Couple', 'Capture a photo of yourself standing in front of a colorful graffiti wall, wearing a trendy outfit and holding a pair of sunglasses.', '{"https://picsum.photos/id/334/400/400","https://picsum.photos/id/796/400/400","https://picsum.photos/id/465/400/400"}', NULL), (146, DEFAULT, 10, 'Laughter and Memories', 'Recreate by posing on a skateboard, wearing a helmet and holding a skateboard.', '{"https://picsum.photos/id/744/400/400","https://picsum.photos/id/672/400/400","https://picsum.photos/id/535/400/400"}', NULL), (147, DEFAULT, 10, 'Sunny Days', 'Sit on a boat, wearing a life jacket and holding a fishing rod.', '{"https://picsum.photos/id/583/400/400","https://picsum.photos/id/524/400/400","https://picsum.photos/id/415/400/400"}', NULL), (148, DEFAULT, 10, 'Foodie Fun', 'Capture a photo of yourself standing in front of a beautiful waterfall, wearing a swimsuit and holding a towel.', '{"https://picsum.photos/id/728/400/400","https://picsum.photos/id/963/400/400","https://picsum.photos/id/792/400/400"}', NULL), (149, DEFAULT, 10, 'Cozy Morning', 'To recreate, find a vintage-inspired background, wear a flowy dress and hold a vintage-style camera.', '{"https://picsum.photos/id/890/400/400","https://picsum.photos/id/324/400/400","https://picsum.photos/id/281/400/400"}', NULL), (150, DEFAULT, 10, 'Laughter and Memories', 'Recreate by posing in front of a city skyline at sunset, wearing a business suit and holding a briefcase.', '{"https://picsum.photos/id/16/400/400","https://picsum.photos/id/474/400/400","https://picsum.photos/id/590/400/400"}', NULL);
